import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Stateless from './components/Stateless.js';
import Stateful from './components/Stateful.js';
import reportWebVitals from './reportWebVitals';
import PresentacionalConstante from './components/PresentacionalConstante.js';
import Button1 from './components/Button1.jsx';
import Button from './components/Button.jsx';
import GetGreeting from './components/GetGreeting.jsx';

ReactDOM.render(
  <React.StrictMode>
    <Stateless />
    <Stateful />
    <PresentacionalConstante />
    <Button1 text="Aceptar mundo"/>
    <Button text="Aceptar mundo"/>
    <GetGreeting />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
